const WorkspaceContext = createContext();

export const WorkspaceProvider = ({ children }) => {
    const obj = { name: 'aravind' };

    return (
      <PlaygroundContext.Provider value={obj}>
        {children}
      </PlaygroundContext.Provider>
    );
};
